import React from "react";

export default function Quote() {
  return (
    <div>
    <img className="w-full" src="https://res.cloudinary.com/dm8nr1vwr/image/upload/v1650024548/Oasis%20Integrated%20Health/cta-buffer_d4rvwp.svg" loading="lazy" decoding="async" alt="wave buffer image" />
